import { FaBars } from 'react-icons/fa';

const NavBar = () => {
  <nav>
    <ul>
      <li><img src="https://cdn.pixabay.com/photo/2016/08/23/06/35/ballet-dancer-1613639_960_720.png" alt="" /></li>
      <li><FaBars /></li>
    </ul>
  </nav>;
};

export default NavBar;
